template <int M, int K, int N>
__attribute__((device)) inline __attribute__((always_inline)) void mma(float (&a)[M][K], float (&b)[K][N], float (&c)[M][N]) {
    for (int m = 0; m < M; ++m) {
        for (int n = 0; n < N; ++n) {
            for (int k = 0; k < K; ++k) {
                c[m][n] += a[m][k] * b[k][n];
            }
        }
    }
}


