void __attribute__((global)) inline init_kernel(float* __restrict__ a, float v, int n) {
    const int stride = blockDim.x * gridDim.x;
    int tid = threadIdx.x + blockIdx.x * blockDim.x;
    while (tid < n) {
        a[tid] = v;
        tid += stride;
    }
}

