template <int warpSize>
__attribute__((device)) inline __attribute__((always_inline)) float warp_reduce(float data) {
    int lane = threadIdx.x % warpSize;
    for (int i = 1; i < warpSize; i *= 2)
        data += __shfl_xor(data, i);
    return data;
}

__attribute__((device)) constexpr unsigned int next_power_of_2(const unsigned int a) {
    unsigned int v = a;
    v--;
    v |= v >> 1;
    v |= v >> 2;
    v |= v >> 4;
    v |= v >> 8;
    v |= v >> 16;
    v += 1;
    return v;
}

